import React from 'react';
import './App.css';
import Button from './components/button';
import { AuthProvider } from './context/Authcontext';
import { BrowserRouter } from 'react-router-dom';

function App() {
  return (

    <BrowserRouter>
      <AuthProvider>
        <div className="App">
          <Button label="Click Me to logout" />
        </div>
      </AuthProvider>
    </BrowserRouter>

  );
}

export default App;
